To achieve this, you can use JavaScript's built-in methods for sorting and iterating over keys in a dictionary (also known as an object). Here's a simple example using a dictionary with some unsorted key-value pairs:

```javascript
const dict = { 
    b: 2,
    a: 1,
    c: 3
};

// Convert the dictionary to an array of [key, value] pairs
const entries = Object.entries(dict);

// Sort the entries by their keys alphabetically
entries.sort((a, b) => {
    const keyA = a[0];
    const keyB = b[0];

    if (keyA < keyB) return -1;
    if (keyA > keyB) return 1;
    return 0;
});

// Iterate over the sorted entries and output values by their keys
for (const [key, value] of entries) {
    console.log(value);
}
```

This code will sort the dictionary's keys alphabetically (in this case, 'a', 'b', 'c') and then print out the values in that order: 1, 2, 3. You can modify this code to work with your own dictionaries by replacing the `dict` object with your desired key-value pairs.
